import org.apache.nifi.flowfile.FlowFile
import groovy.json.JsonSlurper
flowFile = session.get()
processFlowFile(flowFile)

void processFlowFile(FlowFile flowFile) {
    //flowFile = session.get()
    if (!flowFile) return
    try {
        def TempJsonContent = flowFile.getAttribute('TempJsonContent')
        def TempxpathJsondefn = flowFile.getAttribute('TempxpathJsondefn')
        def jsonSlurper = new JsonSlurper()
        def ContentObject =jsonSlurper.parseText(TempJsonContent)
        def DefnObject =jsonSlurper.parseText(TempxpathJsondefn)
        DefnObject.each {
            if(it.value)
            {
                def xArray = it.value.split('[.]');
                def tempObject = ContentObject
                for (item in xArray)
                {
                    if (tempObject) {
                        tempObject = tempObject.get(item)
                    }
                 }
                def jsonstring  = groovy.json.JsonOutput.toJson(tempObject)
                flowFile = session.putAttribute(flowFile, it.key,  jsonstring)
            }
        }
        session.transfer(flowFile, REL_SUCCESS)

    } catch (e) {
        log.error('Something went wrong', e)
        session.transfer(flowFile, REL_FAILURE)
    }
}

